import{_ as e,c as a,a3 as i,o as d}from"./chunks/framework.DjaJQDIS.js";const m=JSON.parse('{"title":"What is Timeago - v3","description":"Learn about Timeago, a fast, lightweight date and time library that converts a given date into a \\"time ago\\" format","frontmatter":{"outline":"deep","title":"What is Timeago - v3","description":"Learn about Timeago, a fast, lightweight date and time library that converts a given date into a \\"time ago\\" format"},"headers":[],"relativePath":"v3/what-is-timeago.md","filePath":"versions/v3/what-is-timeago.md","lastUpdated":1732700824000}'),o={name:"v3/what-is-timeago.md"};function r(n,t,s,l,h,u){return d(),a("div",null,t[0]||(t[0]=[i('<h1 id="what-is-timeago" tabindex="-1">What is Timeago? <a class="header-anchor" href="#what-is-timeago" aria-label="Permalink to &quot;What is Timeago?&quot;">​</a></h1><p>Timeago is a fast and lightweight library for working with dates and times. It transforms a given date into a human-readable &quot;time ago&quot; format, calculating the difference between the specified date and the current date. It supports both past and future dates, making it versatile for various use cases.</p><p>With its simple API and support for multiple languages, Timeago seamlessly adapts to different applications, whether you&#39;re building user interfaces, handling localized content, or working with changing or real-time dates.</p><h2 id="features" tabindex="-1">Features <a class="header-anchor" href="#features" aria-label="Permalink to &quot;Features&quot;">​</a></h2><p>The library has several nice features, such as:</p><ul><li>📅 Flexible date parsing, supporting both <a href="/v3/usage.html#date-in-the-past">past and future dates</a></li><li>⚙️ Configurable library with ability to pass <a href="/v3/options.html">options</a> to suit various use cases, <a href="/v3/configurations.html#translation-overrides">override translations</a> or <a href="/v3/configurations.html#modify-the-output-format">modify the output format</a></li><li>✅ Comprehensive test coverage for reliability</li><li>🌐 Timeago support multiple languages such as English, Russian, Ukrainian, Dutch, German, Chinese, Belarusian, Spanish and more. You can also easily contribute more following our <a href="/v3/contribute.html">step-by-step guide</a></li><li>📦 Compact codebase for minimal footprint</li><li>🕰️ Unix timestamp parsing</li><li>⏱️ Support for date-time strings in the <code>YYYY-MM-DD HH:MM:SS</code> format</li><li>📆 Compatibility with <code>time.Time</code> struct from the Go standard library</li><li>✍️ Easy <a href="/v3/contribute.html">contribution</a> of new language support</li><li>📝 Detailed <a href="https://github.com/SerhiiCho/timeago/blob/main/CHANGELOG.md" target="_blank" rel="noreferrer">CHANGELOG.md</a> for all updates and features</li><li>📖 Thorough documentation for ease of use</li></ul><h2 id="supported-languages" tabindex="-1">Supported Languages <a class="header-anchor" href="#supported-languages" aria-label="Permalink to &quot;Supported Languages&quot;">​</a></h2><p>Timeago supports multiple languages, and you’re welcome to <a href="/v3/contribute.html">contribute</a> additional ones. Check out the languages currently available:</p><table tabindex="0"><thead><tr><th>#</th><th>Flag</th><th>Language</th><th>ISO 639-1 Code</th><th>Const</th></tr></thead><tbody><tr><td>1</td><td>🇬🇧</td><td>English</td><td>en</td><td><code>timeago.LangEn</code></td></tr><tr><td>2</td><td>🇷🇺</td><td>Russian</td><td>ru</td><td><code>timeago.LangRu</code></td></tr><tr><td>3</td><td>🇺🇦</td><td>Ukrainian</td><td>uk</td><td><code>timeago.LangUk</code></td></tr><tr><td>4</td><td>🇳🇱</td><td>Dutch</td><td>nl</td><td><code>timeago.LangNl</code></td></tr><tr><td>5</td><td>🇩🇪</td><td>German</td><td>de</td><td><code>timeago.LangDe</code></td></tr><tr><td>6</td><td>🇨🇳</td><td>Chinese</td><td>zh</td><td><code>timeago.LangZh</code></td></tr><tr><td>7</td><td>🇧🇾</td><td>Belarusian</td><td>be</td><td><code>timeago.LangBe</code></td></tr><tr><td>8</td><td>🇪🇸</td><td>Spanish</td><td>es</td><td><code>timeago.LangEs</code></td></tr><tr><td>9</td><td>🇯🇵</td><td>Japanese</td><td>ja</td><td><code>timeago.LangJa</code></td></tr><tr><td>10</td><td>🇫🇷</td><td>French</td><td>fr</td><td><code>timeago.LangFr</code></td></tr></tbody></table>',9)]))}const c=e(o,[["render",r]]);export{m as __pageData,c as default};
